import React, { Component } from "react";
import { Link, Navigate } from "react-router-dom";
import axios from "axios";
import "./index.css";

class SignIn extends Component {
  state = {
    us: "",
    pd: "",
    showSubmitError: false,
    errorMsg: "",
    submitForm: false,
    usError: false, // Track username error state
    pdError: false, // Track password error state
  };

  onSubmitForm = async (event) => {
    event.preventDefault();

    const { us, pd } = this.state;

    if (!us || !pd) {
      // Check if username or password is empty
      if (!us) {
        this.setState({ usError: true });
      }
      if (!pd) {
        this.setState({ pdError: true });
      }
      return;
    }

    try {
      const response = await axios.post("http://localhost:8000/login/", {
        username: us,
        password: pd,
      });

      if (response.status === 200) {
        this.setState({ submitForm: true, usError: false, pdError: false });
        this.props.setIsAuthenticated(true);
        console.log("success");
      }
    } catch (error) {
      if (error.response && error.response.data) {
        this.setState({
          showSubmitError: true,
          errorMsg: error.response.data.detail,
          usError: false,
          pdError: false,
        });
      } else {
        this.setState({
          showSubmitError: true,
          errorMsg: "*Invalid Username or Password",
          usError: false,
          pdError: false,
        });
      }
      console.log("login failed");
    }
  };

  onEnterUsername = (event) => {
    this.setState({ us: event.target.value, usError: false });
  };

  onChangePassword = (event) => {
    this.setState({ pd: event.target.value, pdError: false });
  };

  renderUsername = () => {
    const { us, usError } = this.state;

    return (
      <>
        <label className="label" htmlFor="userName">
          USERNAME
        </label>
        <input
          type="text"
          id="userName"
          placeholder="Username"
          className={`user-input1 ${usError ? "error" : ""}`} // Apply error class if usError is true
          value={us}
          onChange={this.onEnterUsername}
          style={{ color: "white" }}
        />
        {usError && <p className="required-msg">Required</p>}
      </>
    );
  };

  renderPassword = () => {
    const { pd, pdError } = this.state;

    return (
      <>
        <label className="label" htmlFor="password">
          PASSWORD
        </label>
        <input
          className={`user-input1 ${pdError ? "error" : ""}`} // Apply error class if pdError is true
          id="password"
          type="password"
          placeholder="Password"
          value={pd}
          onChange={this.onChangePassword}
        />
        {pdError && <p className="required-msg">Required</p>}
      </>
    );
  };

  render() {
    const { showSubmitError, errorMsg, submitForm } = this.state;
    console.log(submitForm);
    return (
      <div className="jobby-app-container">
        <div className="card">
          <img
            src="https://res.cloudinary.com/dlkovvlud/image/upload/v1699081090/Design_a_modern_and_captivating_logo_for_the_Gen-removebg-preview_2_vl2kfw.png"
            alt="website logo"
            className="website-logo"
          />
          <center>
            <h1 className="heading-login">Signin</h1>
          </center>
          <form className="form-container" onSubmit={this.onSubmitForm}>
            <div className="input-container">{this.renderUsername()}</div>
            <div className="input-container">{this.renderPassword()}</div>
            {showSubmitError && <p className="error-msg">{errorMsg}</p>}
            <button className="login-button" type="submit">
              Login
            </button>
            <div className="signupp">
              <p className="nothave">Don't have an account</p>
              <Link to="/signup">
                <p className="signup-para">Signup</p>
              </Link>
            </div>
          </form>
          {submitForm ? <Navigate to="/Home" /> : null}
        </div>
      </div>
    );
  }
}

export default SignIn;
